import { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import ReactPlayer from "react-player";

export default function EntryPage() {
  const navigate = useNavigate();
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const timer = setTimeout(() => setLoading(false), 3000);
    return () => clearTimeout(timer);
  }, []);

  const handleOption = (answer) => {
    if (answer === "recruit") {
      navigate("/recruitment");
    } else {
      navigate("/admin-login"); // Corrected to go to the login page
    }
  };

  if (loading) {
    return (
      <div className="flex items-center justify-center h-screen bg-gradient-to-r from-purple-800 via-black to-purple-800">
        <div className="text-center animate-pulse">
          <img
            src="https://eetgxwgbysyezclsecwd.supabase.co/storage/v1/object/public/public-assets//Asset%202%20(2).png"
            alt="Obscura Logo"
            className="mx-auto w-32 md:w-48 lg:w-56 animate-bounce"
          />
          <h1 className="text-3xl md:text-4xl lg:text-5xl font-bold text-purple-200 mt-4 shadow-lg">
            Welcome to Obscura
          </h1>
        </div>
      </div>
    );
  }

  return (
    <div
      className="min-h-screen bg-cover bg-center flex flex-col items-center justify-center text-white px-4"
      style={{
        backgroundImage:
          "url('https://eetgxwgbysyezclsecwd.supabase.co/storage/v1/object/public/public-assets//wallpaperflare.com_wallpaper%20(57).jpg')",
      }}
    >
      <img
        src="https://eetgxwgbysyezclsecwd.supabase.co/storage/v1/object/public/public-assets//Asset%202%20(2).png"
        alt="Obscura Logo"
        className="w-48 md:w-64 lg:w-72 mb-6 drop-shadow-xl animate-bounce"
      />
      <p className="text-lg md:text-xl mb-6 bg-black/50 p-4 rounded-lg shadow-md">
        Are you here to be recruited or are you an admin?
      </p>
      <div className="flex flex-wrap justify-center gap-4 mb-8">
        <button
          onClick={() => handleOption("recruit")}
          className="bg-purple-600 hover:bg-purple-700 active:scale-95 px-6 py-3 rounded-lg shadow-lg font-semibold transition-transform duration-200 transform hover:scale-105"
          title="Apply to join Obscura"
        >
          I'm being recruited
        </button>
        <button
          onClick={() => handleOption("admin")}
          className="bg-gray-700 hover:bg-gray-600 active:scale-95 px-6 py-3 rounded-lg shadow-lg font-semibold transition-transform duration-200 transform hover:scale-105"
          title="Access admin dashboard"
        >
          I'm an admin
        </button>
      </div>

      <div className="relative w-full max-w-3xl">
        <div className="absolute left-0 top-1/2 transform -translate-y-1/2 flex flex-col gap-4">
          <a href="https://www.tiktok.com/@obscura_e_sports?_t=8r4yZXkvp6E&_r=1" target="_blank" rel="noopener noreferrer">
            <img src="https://eetgxwgbysyezclsecwd.supabase.co/storage/v1/object/public/public-assets//Asset%2010.png" alt="TikTok" className="w-8 md:w-10 hover:scale-110 transition" />
          </a>
          <a href="https://x.com/Obscuraesports" target="_blank" rel="noopener noreferrer">
            <img src="https://eetgxwgbysyezclsecwd.supabase.co/storage/v1/object/public/public-assets//Twitter%20New%20X%20Logo%20Icons-08.png" alt="Twitter" className="w-8 md:w-10 hover:scale-110 transition" />
          </a>
          <a href="https://www.facebook.com/profile.php?id=61566312790023" target="_blank" rel="noopener noreferrer">
            <img src="https://eetgxwgbysyezclsecwd.supabase.co/storage/v1/object/public/public-assets//Asset%205.png" alt="Facebook" className="w-8 md:w-10 hover:scale-110 transition" />
          </a>
          <a href="https://www.youtube.com/@ObscuraEsports" target="_blank" rel="noopener noreferrer">
            <img src="https://eetgxwgbysyezclsecwd.supabase.co/storage/v1/object/public/public-assets//Asset%2015.png" alt="YouTube" className="w-8 md:w-10 hover:scale-110 transition" />
          </a>
        </div>

        <ReactPlayer
          url="https://www.youtube.com/watch?v=PyfPbCRWL2Y"
          playing
          loop
          muted
          controls={false}
          width="100%"
          height="360px"
          className="rounded-xl shadow-2xl"
        />
      </div>
    </div>
  );
}
